import React from "react";

export default function Main(){
    return(
        <main>
            <h1 className="main--title">Facts About the world </h1>
            <ul className="main--facts">
                <li>The deck is stacked</li>
                <li>The rules are rigid</li>
                <li>You can either be in or out</li>
                <li>And Dont care if you loved or hated as long as you win</li>
                <li>Powers thousands of enterprise apps, including mobile apps</li>
            </ul>
        </main>
    )
}
